import React from 'react';
import s from "./Counter.module.css"

type SuperCounterType = {
    inc: () => void
    value: number
    reset: () => void
    disable:number
    MaxValue:number
    MinValue:number

}


export const SuperCounter = (props: SuperCounterType) => {


    const Inc = () => {
        props.inc()
    }

    const Reset = () => {
        props.reset()
    }
    return (
        <div className={s.around_wrapper}>
            <div className={props.value >= props.disable ? s.error : ''}>{props.MinValue>=props.MaxValue ? 'mistake': props.value}</div>
            <button  className={s.button} onClick={Inc} disabled={props.value >= props.disable}>inc</button>
            <button onClick={Reset}>reset</button>
        </div>
    );
};
